import Header from './components/Header.js';
import Notes from './components/Notes.js';
import Footer from './components/Footer.js';
import Table from './components/Table.js';

function App() {
  return (
    <>
      <main className='m-5 p-5 xl:max-w-4xl xl:mx-auto bg-white ronded shadow'>

        <Header />


        <section className='flex flex-col items-end justify-end'>
          <h2 className='text-xl uppercase'>Rohan </h2>
          <p>Address</p>
        </section>

{/* Client Details */}
        <section className='mt-5'>
          <h2 className='text-xl uppercase'>Client's name</h2>
          <p>Client's Address</p>
        </section>
{/* End of Client's Details */}

      <article className='my-5 flex items-end justify-end'>
        <ul>
          <li><span className='font-bold'>Invoice number: </span></li>
          <li><span className='font-bold'>Invoice date: </span></li>
          <li><span className='font-bold'>Due date:</span> </li>
        </ul>
      </article>

      <Table />

      <Notes />

      <Footer />

      </main>
    </>
  );
}

export default App;
